import React from "react";
import {
    ThemeProvider,
    Editable,
    EditablePreview,
    EditableInput,
    Input
} from "@chakra-ui/core";
function Index({ children }) {
    return (
        <ThemeProvider>
            <Input  placeholder="Basic usage" />
            <Editable className="test" defaultValue="Take some chakra">
                <EditablePreview />
                <EditableInput />
            </Editable>
        <style jsx>
            {`
            .test {
                width: 100px;
                margin: 0 auto;
                background: #000;
            }
            `}
        </style>
        </ThemeProvider>
    );
}
